import React from "react";
import { Link } from "react-router-dom";
import { Table, Button } from "antd";
import {columns} from "./UPSCCMS.js";
import pdf1_1 from "../pdf/sbi/2022/sbi-clerk-question-paper-2022.pdf";
import pdf1_2 from "../pdf/sbi/2021/sbi-clerk-mains-2021-question-paper.pdf";
import pdf1_3 from "../pdf/sbi/2021/sbi-clerk-mains-2021-question-paper.pdf";
import pdf1_4 from "../pdf/sbi/2021/sbi-clerk-mains-2021-question-paper.pdf";
import pdf1_5 from "../pdf/sbi/mechnaical_paper1_2019.pdf";
import pdf1_6 from "../pdf/sbi/mechnaical_paper2_2019.pdf";
import pdf1_7 from "../pdf/sbi/cse_2022paper1.pdf";
import pdf1_8 from "../pdf/sbi/2022/sbi-clerk-question-paper-2022.pdf";


function sbi() {
  const dataSource = [
    {
      key: "1",
      name: "sbi",
      year: "2022",
      batch: "1",
      address: (
        <a href={pdf1_1} target="_blank">
          Download
        </a>
      ),
    },
    {
      key: "2",
      name: "sbi",
      year: "2022",
      batch: "2",
      address: (
        <a href={pdf1_2} target="_blank">
          Download
        </a>
      ),
    },
    {
        key: "3",
        name: "sbi",
        year: "-",
        batch: "1",
        address: (
          <a href={pdf1_3} target="_blank">
            Download
          </a>
        ),
      },
      {
        key: "4",
        name: "sbi",
        year: "-",
        batch: "1",
        address: (
          <a href={pdf1_4} target="_blank">
            Download
          </a>
        ),
      },
      {
        key: "5",
        name: "sbi",
        year: "2019",
        batch: "1",
        address: (
          <a href={pdf1_5} target="_blank">
            Download
          </a>
        ),
      },
      {
        key: "6",
        name: "sbi",
        year: "2019",
        batch: "2",
        address: (
          <a href={pdf1_6} target="_blank">
            Download
          </a>
        ),
      },
      {
        key: "7",
        name: "sbi",
        year: "-",
        batch: "1",
        address: (
          <a href={pdf1_7} target="_blank">
            Download
          </a>
        ),
      },
      {
        key: "8",
        name: "sbi",
        year: "-",
        batch: "1",
        address: (
          <a href={pdf1_8} target="_blank">
            Download
          </a>
        ),
      },
  ];

  return (
    <>
      <h1>Defence Research and Development Organisation</h1>
      <div>
        <h2>sbi Previous Year Question Papers and Answers</h2>
        <Table dataSource={dataSource} columns={columns} />
      </div>
      <div style={{ textAlign: "right", marginRight: "160px" }}>
        <Link to="/">
         <Button type="primary">BACK</Button>
        </Link>
      </div>
    </>
  );
}

export default sbi;
